export const loginHandler = async (number,password) =>{
    try{
        const data = await axios.post("https://travelapp-backend-cdeh.onrender.com/api/auth/login",{number:number,password,password})
        console.log(data)

    }catch(err){
        console.log("unable to login")
    }

}
